describe('Navbar component', () => {
  it('opens and closes', (done) => {
    const navbar = mount(<Navbar
      brand={<a href="/">Brand</a>}
      links={[
        <a href="/">a</a>,
        <a href="/">b</a>,
        <a href="/">c</a>,
