    const toggler = navbar.find('.navbar-toggler').at(0);

    // open nav
    toggler.simulate('click');
    navbar.update();
    expect(toJSON(navbar)).toMatchSnapshot();

    setTimeout(() => {
      // wait to open
      navbar.update();
      expect(toJSON(navbar)).toMatchSnapshot();

      // close nav
      toggler.simulate('click');
      navbar.update();
      expect(toJSON(navbar)).toMatchSnapshot();

      setTimeout(() => {
        // wait to close
